import React, { Component } from 'react';
import './Styles/Navbar.css';
import Logo from './Images/logo.png'

class Navbar extends Component {
    render() {
        return (
            <div>
            <div>
                <img id="Logo" src={Logo} />
            </div>    
            <div id="Navbar">
                    <div id="NavLinks">
                        <a className="NavItem" onClick={Scroll}>Contact</a>
                        <a className="NavItem" onClick={Scroll}>Images</a>
                        <a className="NavItem" onClick={Scroll}>Queries</a>
                        <a className="NavItem" onClick={Scroll}>Products</a>
                        <a className="NavItem" onClick={Scroll}>About</a>
                    </div>
            </div>
            </div>
        );
    }
}

export default Navbar;
